description:
Call on hazel grouse - for active speakers
Functional:
- Three voices of a male;
- Three female voices;
- Duo two voices;
- Chirping;
- Repeat;
- Stop;

В данном приложении представлены голоса ЛОСЯ и другие звуки, которые возможно услышать в период гона этих животных (на реву).
Всего 21 трек:
самцы молодой и старый - 7 треков;
самки - 6 треков;
8 треков - звуки боя, стук рогов о деревья и создаваемый шум в движении, голос теленка.
Все голоса на voice-animals.ru
Приложение, предназначено для использования с активными динамиками, устройствами воспроизведения звука с использованием технологии bluetooth и др.
Оптимально подобранный, по частотной составляющей, активный динамик позволит, используя данное приложение, эффективно приманивать данный вид животных.
Приложение предназначено для имитации голосов:
- в целях тренировки при подготовке к охоте с использованием духового манка;
- в научно-исследовательских целях;
- в познавательных, развлекательных целях;
В соответствии с  п.п. 52.14. «Правил охоты» при отлове и (или) отстреле охотничьих животных запрещается: применение электронных устройств, имитирующих звуки, издаваемые охотничьими животными и иными животными, за исключением осуществления охоты в целях осуществления научно-исследовательской деятельности, охоты в целях регулирования численности, а также охоты на волков, шакалов и ворон (серой, черной и большеклювой), в случае отнесения последних законами субъектов Российской Федерации к охотничьим ресурсам;
В программе предусмотрен повтор голосов, который реализовывается путем нажатия соответствующей кнопки  "Повтор" при воспроизведении одного из голосов.

